  import React from 'react'
import { useContacts } from '../contexts/contactsprovider';

export default function Contacts() {
  const { contacts } = useContacts()

  return (
    <ul>
      {contacts.map(contact => (
        <li key={contact.id}>
          {contact.name}
        </li>
      ))}
    </ul>
  )};
